ads.description:
Na sprzedaż wyjątkowo komfortowa i przestronna Mazda 6 w wersji Exclusive, z dynamicznym i oszczędnym silnikiem 2.0 Diesel – idealna na długie trasy! Auto w moich rękach od 4 lat, głównie użytkowane na trasach autostradowych.



Zalety i wyposażenie:

Wersja Exclusive

Skórzana tapicerka 

Dwustrefowa automatyczna klimatyzacja 

Elektrycznie regulowane fotele 

Lusterko fotochromatyczne 

Bardzo przestronna kabina – z tyłu więcej miejsca niż w wielu nowych sedanach!



W ostatnim roku zrobione:

- Wymiana rozrządu;

- Sprawdzenie turbiny;

- Nowa chłodnica klimatyzacji;

- Wymienione: łożysko koła, zacisk hamulca, wahacze, mechanizm szyby pasażera;

- Na bieżąco wymieniane oleje, filtry, tarcze i klocki.



Do zrobienia:

- Skrzynia biegów – brak 6 biegu - pozostałe działają choć ją słychać;

- Brak ważnego przeglądu skończył się w zeszłym miesiącu;

- Niedziałający mechanizm sterowania lusterkami.



Wizualne mankamenty:

- Rdza na klapie bagażnika – klasyka Mazdy - reszta trzyma się kupy;

- Schodzi farba na przednim zderzaku i lusterkach;

- Starcie farby na kierownicy.
